import {FaTimes} from 'react-icons/fa'

const Trade = ({ trade }) => {
  return (
    <div className='trade'>
        <h3>
            {trade.text} <FaTimes style={{color:'red', cursor:'pointer'}} />
        </h3>
        <p>Sent: {trade.sent}</p>
        <p>Received: {trade.received}</p>
    </div>
  )
}

export default Trade
